import React from 'react';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';

const styles = theme => ({
  root: {
    width: '100%',
    marginTop: theme.spacing.unit * 3,
    overflowX: 'auto',
  },
  table: {
    Width: '100%',
  },
});

let id = 0;
function createData(name, dag, datum, dienst) {
  id += 1;
  return { id, name, dag, datum, dienst };
}

const rows = [
  createData('Ma', 'mei', 6.0, 'ochtend'),
  createData('Di', 237, 9.0, 'ochtend'),
  createData('Wo', 262, 16.0, 'ochtend'),
  createData('Do', 305, 3.7, 'middag'),
  createData('Vr', 356, 16.0, 'middag'),
  createData('Za', 356, 16.0, ),
  createData('Zo', 356, '', ),
];

function SimpleTable(props) {
  const { classes } = props;

  return (
    <Paper className={classes.root}>
      <Table className={classes.table}>
        <TableHead>
          <TableRow>
            <TableCell>Dag</TableCell>
            <TableCell align="right">Datum</TableCell>
            <TableCell align="right"></TableCell>
            <TableCell align="right">Dienst</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
          {rows.map(row => (
            <TableRow key={row.id}>
              <TableCell component="th" scope="row">
                {row.name}
              </TableCell>
              <TableCell align="right">{row.dag}</TableCell>
              <TableCell align="right">{row.datum}</TableCell>
              <TableCell align="right">{row.dienst}</TableCell>
            </TableRow>
          ))}
        </TableBody>
      </Table>
    </Paper>
  );
}

SimpleTable.propTypes = {
  classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(SimpleTable);
